import React from 'react'
import { View,Text,StyleSheet } from 'react-native'

export default function App() {
  return (
   <View>
    <Text style={styles.TextStyle}>Its Show right or not </Text>
    <Text style={styles.TextStyle}>Its Show Good or not </Text>
   </View>
  )
}
const styles=StyleSheet.create({
  TextStyle:{
    fontSize:25,backgroundColor:'blue',
    color:'#fff',padding:15,
    margin:15
    ,textAlignVertical:'center',
    textAlign:'center',
    width:120,

    height:120
  }
})

